    private void CBR(Diamond diamond)
    {
        ActionDiamond.Close();

        Console.WriteLine(diamond);

        DiamondCBR cbr = new DiamondCBR(diamond, DiamondList);
        Diamond myDiamond;
        Diamond simDiamond;
        var similarity = cbr.Result(out myDiamond, out simDiamond);

